import React from 'react';
import Card from './Card';
import Sdata from './Sdata';


const Amazon = () => {
    return(
        <Card 
        key={Sdata[5].id}
        sname={Sdata[5].sname}
        imgsrc={Sdata[5].imgsrc}
        title={Sdata[5].title}
        link={Sdata[5].links}
    />
    );
}


export default Amazon;
